CREATE TABLE jobs (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT NOT NULL, image TEXT NOT NULL, erstellungs_datum DATETIME DEFAULT CURRENT_TIMESTAMP, author_id INTEGER NOT NULL, firma TEXT NOT NULL, description TEXT, FOREIGN KEY (author_id) REFERENCES users(id));
-- Job schema
CREATE TABLE job (id INTEGER primary key AUTOINCREMENT, name text not null, image text not null, date date not null, author text not null, firma text not null, description text);

-- Users table
CREATE TABLE users (id INTEGER PRIMARY KEY AUTOINCREMENT, first_name TEXT NOT NULL, last_name TEXT NOT NULL, email TEXT UNIQUE NOT NULL, password TEXT NOT NULL, role TEXT NOT NULL, firma TEXT NOT NULL);
INSERT INTO users (first_name, last_name, email, password, role, firma) VALUES ('John', 'Doe', 'john.doe@example.com', 'hashed_password', 'admin', 'ACME Corp');

-- Jobs table
CREATE TABLE jobs (id INTEGER PRIMARY KEY AUTOINCREMENT, name TEXT NOT NULL, erstellungs_datum DATETIME DEFAULT CURRENT_TIMESTAMP, author_id INTEGER NOT NULL, firma TEXT NOT NULL, description TEXT, FOREIGN KEY (author_id) REFERENCES users(id));
INSERT INTO jobs (name, author_id, firma, description) VALUES ('Data Processing Job', 1, 'ACME Corp', 'This job processes daily sales data');

-- Configuration tables
CREATE TABLE config_tables (id INTEGER PRIMARY KEY AUTOINCREMENT, job_id INTEGER NOT NULL, table_name TEXT NOT NULL, table_data TEXT NOT NULL, FOREIGN KEY (job_id) REFERENCES jobs(id));
INSERT INTO config_tables (job_id, table_name, table_data) VALUES (1, 'Sales Data', '{"columns": ["Date", "Product", "Amount"], "data": [["2023-05-01", "Widget A", 100]]}');

-- Global variables
CREATE TABLE global_variables (id INTEGER PRIMARY KEY AUTOINCREMENT, job_id INTEGER NOT NULL, variable_name TEXT NOT NULL, variable_value TEXT, FOREIGN KEY (job_id) REFERENCES jobs(id));
INSERT INTO global_variables (job_id, variable_name, variable_value) VALUES (1, 'MAX_RETRIES', '3');

-- Nodes
CREATE TABLE nodes (id INTEGER PRIMARY KEY AUTOINCREMENT, job_id INTEGER NOT NULL, node_type TEXT NOT NULL, position_x REAL NOT NULL, position_y REAL NOT NULL, additional_info TEXT, FOREIGN KEY (job_id) REFERENCES jobs(id));
INSERT INTO nodes (job_id, node_type, position_x, position_y, additional_info) VALUES (1, 'data_input', 100.0, 50.0, '{"input_file": "sales.csv"}');

-- Schedules
CREATE TABLE schedules (id INTEGER PRIMARY KEY AUTOINCREMENT, job_id INTEGER NOT NULL, schedule_type TEXT NOT NULL, start_time DATETIME, end_time DATETIME, recurrence_pattern TEXT, FOREIGN KEY (job_id) REFERENCES jobs(id));
INSERT INTO schedules (job_id, schedule_type, start_time, recurrence_pattern) VALUES (1, 'recurring', '2023-05-01 00:00:00', 'daily');

-- Code snippets
CREATE TABLE code_snippets (id INTEGER PRIMARY KEY AUTOINCREMENT, node_id INTEGER NOT NULL, snippet_name TEXT NOT NULL, snippet_content TEXT NOT NULL, FOREIGN KEY (node_id) REFERENCES nodes(id));
INSERT INTO code_snippets (node_id, snippet_name, snippet_content) VALUES (1, 'data_processing', 'def process_data(data):\n    # Processing logic here\n    return processed_data');

-- Edges
CREATE TABLE edges (id INTEGER PRIMARY KEY AUTOINCREMENT, job_id INTEGER NOT NULL, source_node_id INTEGER NOT NULL, target_node_id INTEGER NOT NULL, FOREIGN KEY (job_id) REFERENCES jobs(id), FOREIGN KEY (source_node_id) REFERENCES nodes(id), FOREIGN KEY (target_node_id) REFERENCES nodes(id));
INSERT INTO edges (job_id, source_node_id, target_node_id) VALUES (1, 1, 2);

